                "description": " with Terra Lightfoot<br> Rock n roll has rarely been as smart, soulful or satisfying than it has in the hands of The Posies. During an on/off career thats stretched across four decades, the Seattle-rooted outfit, led by musical polymaths Jon Auer and Ken Stringfellow, have shaped and re-shaped their muse, creating one of the more compelling catalogues in modern pop.With SOLID STATES, their 8th album, the Posies mark dramatic changes in the lives, the music, the evolution of the band.When the Posies long time drummer, Darius, died suddenly and unexpectedly last year, Posies founding members Jon Auer and Ken Stringfellow were devastated. Hard as it was to continue without such a close friend and great musician, the moment called for a reinvention. For now the idea of the band getting into a room and banging out the music, garage band style, was over. The ideas coming from Jon and Ken were fragile and the moods contemplative. Death, divorce, loss. Even the joys of life are fleeting enough as to be treated with care and respect.Of course, the Posies still retain their legendary melodic abilities, their trademark vocal harmonies and their lyrical agility. The band has always been exploring, growing. The multiyear gaps between albums are typically spent in countless other projects that bring new skills, sounds, experiences and people to the picture. The band will present the album live in a new format, incorporating laptop elements along with guitars, keyboards and drums. As artists, the band feels its their duty to take risks and explore.",
