                "description": " with Null<br> Young Widows celebrate the 10 year anniversary Old Wounds with a string of performances, playing the album in its entirety. Emma Ruth Rundle will be performing solo June 8th through 14th, Alexis Marshall (of the band Daughters) will be reading from his book as well as other poems June 9th through June 14th, and Null from Birmingham Alabama (members of Coliseum) will be performing June 15th through 21st. Looking forward.Young Widows&#39; bruising 2006 debut, Settle Down City, introduced the Louisville, KY trio as an ugly force to be reckoned with. Two years later they dropped Old Wounds, their sophomore stomp that inspired at least a dozen imitators of varying degrees of success. From there the band traded some of their trademark fury for the bleak, widescreen atmospheres of In and Out of Youth and Lightness. Now, three years later, Young Widows meld the strengths of their past and their tenacity for the future to forge Easy Pain, an album perfectly befitting their merciless moniker.",
