                "start_time": "2018-06-07 20:00:00",
                "description": " <p><a href=\"http://www.workplay.com/wp-content/uploads/2018/02/alex-guthrie-sq-6x6.jpg\" rel=\"nofollow\"></a><p><strong><a href=\"http://www.alexguthriemusic.com/\" rel=\"nofollow\">Alex Guthrie</a></strong> is a singer-songwriter based in Atlanta. With the infusion of different genres such as soul, folk and rock, Guthrie brings audiences together through brilliant lyrics and an expressive voice.<p>Most recently, Guthrie has been noted as “the guy from the Jennifer Hudson commercial.” The now-infamous American Family Insurance <a href=\"https://www.youtube.com/watch?v=FpdKo6JnQJA\" rel=\"nofollow\">commercial</a> features him playing in Atlanta’s Woodruff Park when the Grammy Award-Winning singer and performer Jennifer Hudson surprises Guthrie and sings along to Bill Wither’s beloved “Lovely Day.” The commercial has played on national television and radio, resulting in new opportunities and heightened awareness for Alex Guthrie, his band and his music.<p>Guthrie and his band have performed events including <a href=\"https://www.youtube.com/watch?v=BRrPME6Qu50&feature=youtu.be\" rel=\"nofollow\">Milwaukee’s Summerfest</a> — which was also featured on <a href=\"http://www.jimmykimmellivemusic.com/videos/american-family-insurance-summerfest-recap-4\" rel=\"nofollow\">Jimmy Kimmel Live! Music</a> — as well as the 30A Songwriter’s Festival in Florida, Wire and Wood Songwriter Festival in Alpharetta, GA, Jammin’ Java Listening Room in Vienna, VA, the Elbo Room in Chicago, IL and Eddie’s Attic in Atlanta, GA.<p>In the early stages of his career, Guthrie released his first album, <em>Lessons Learned, </em>and also scored the Atlanta Braves Band of the Year in 2014. In 2015, Guthrie and his band were awarded the Georgia Americana Artist of the Year — another astounding achievement bringing his music much-deserved attention and recognition. Within a short span of time, Guthrie was opening up for national touring artists including renowned BMLG Records recording Artist Drake White, RCA recording artist Bleachers, and famous Atlantic Records recording Artist Kelly Clarkson.<p>Singer-songwriter Alex Guthrie continues to impress and defy conventional expectations, making waves as he makes great music. A new album is currently being recorded and is expected to be released in Spring 2018.<p><p><a href=\"http://www.workplay.com/wp-content/uploads/2018/02/IMG_9283.jpg\" rel=\"nofollow\"></a>Born in the Philippines, raised in New York, educated in California and now entertaining Birmingham, AL, is one of the hottest musicians rising out of the growing music scene. Lily has built a buzz beyond just Birmingham, and many of those who follow the local music scene mention her as one of those Birmingham gems that is poised to explode onto the national and international scene. Her music mixes R&B, jazz, pop, folk and funk with her superb songwriting talents. She has played venues all over the country and remains busy with an enormous following on newly the emerging streaming platform, Twitch, and YouTube. She is looking to release a new album this year, and has recently released a video for her single, “<a href=\"https://www.youtube.com/watch?v=pYYQNdhzxoQ\" rel=\"nofollow\">Tinder Love</a>”</p></p></p></p></p></p></p></p>",
