                "description": " <br> Sacramento, CA alternative hip-hop artist Hobo Johnson is Frank Lopes Jr; often backed by his bandmates The Lovemakers. In November 2017, Hobo Johnson released the record The Rise of Hobo Johnson, which Frank wrote during a time he had to live out of his &#39;94 Toyota Corolla - hence his self-given pseudonym. On April 17, 2018, Hobo Johnson released the highly-anticipated single &quot;Peach Scone&quot; (both the studio and live version), which debuted on Spotifys New Music Friday. (Listen to &quot;Peach Scone&quot; here.) The new single comes on the heels of Hobo Johnson&#39;s &quot;Peach Scone&quot; live performance video, which was posted online as a submission for NPRs Tiny Desk contest. The live video of that unreleased track got Hobo Johnson much more than expected. In just 7 weeks, the &quot;Peach Scone&quot; video racked up over 14.6 million views on Facebook and YouTube. Across all socials, their followers have grown from 10,000 total to well over one million followers. Their fervent new fans boosted the 2017 The Rise of Hobo Johnson album to #8 on the iTunes Hip-Hop chart and #11 on Billboard&#39;s Heatseekers chart. Hobo Johnson has also caught the attention of big media players like MTV who tweeted &quot;Very much in love with @_hobojohnson&quot; and a feature from Perez Hilton and The Needle Drop. Five different songs from The Rise of Hobo Johnson have charted on Spotify&#39;s Global Viral 50, US Viral 50, Australia Viral 50, UK Viral 50, Canada Viral 50, Philippines Viral 50, Spain Viral 50, NZ Viral 50, Ireland Viral 50, Netherlands Viral 50. It has also appeared on on Spotify&#39;s Tear Drop, Viral Hits Canada, Viral Hits AUS & NZ. This year, fans can look forward to more US and international tour dates from Hobo Johnson & The Lovemakers.",
