                "country_name": "United States",
                "country_abbr": "USA",
                "region_name": "Alabama",
                "start_time": "2018-06-22 21:00:00",
                "description": " <br> Like many before him, Sam Lewis came to Nashville to make music. But unlike the majority, Lewis managed to hop on one of the most successful tours that country music has seen as of late. He&#39;s collaborated with everyone from John Prine and Kacey Musgraves to The Wood Brothers. Chris Stapleton dubbed him &quot;a modern Townes Van Zandt&quot;. And while he&#39;s often labeled with some form of the word &#39;soulful&#39; (some have even compared his voice to molasses), Lewis&#39; style meets at a juncture of many different genres. There&#39;s something about Sam Lewis that is indescribably different -- and with his newest project, he&#39;s discovered what most musicians spend lifetimes working for -- the place where feel-good music meets vital social commentary. When Lewis decided to make the move from Knoxville to Nashville in summer 2009, he was still working full-time at Walmart (a gig that lasted nearly a decade). In his off-time, he began playing smaller local venues including the 5 Spot, where he met fel- low singer-songwriter Matt Urmy. After forming a friendship, Urmy offered to help Lewis &quot;We went to his basement, I laid down some songs, we pieced a band together and made a record in a couple days at Eastwood Studios.&quot; That record would become Lewis&#39;s first official release and self-titled debut that featured Nashville greats Kenny Vaughan, Reggie Bradley Smith, Dave Jacques, and Derek Mixon. And with Lewis&#39; sole intention of moving to be a musician that &#39;records it and tours it&#39; - he did just that - traveling from Nashville to New York via train to play shows, then spending a month in England. By late 2014, Lewis had turned 30, established himself with the Nashville music scene, and signed with the boutique Georgia label, Brash Records. With the help of Brash and producer Oliver Wood of The Wood Brothers, Lewis released his second full- length, Waiting on You, in April 2015. The sophomore was critically acclaimed and once again featured Kenny Vaughan, in addition to Darrell Scott, Gabe Dixon, the McCrary Sisters, and Willie Nelson&#39;s legendary harmonica player, Mickey Raphael. While No De- pression compared Lewis&#39; soulful style with the likes of Al Green and Van Morrison, Craig Havighurst (Music City Roots) coined Waiting on You as &quot;Americana with a groovy twist&quot;. While the album racked in incredible reviews, Lewis&#39; booking agency also got bought out in the same time frame - unfortunately leaving him with a solid album, but no tour dates to show for it.Lewis applied to work at a Post Office in East Nashville but by the time he got a call for a second interview, someone else had called with a more enticing offer: the open- ing spot for the Traveler release show, Chris Stapleton&#39;s Grammy-winning album. From there, life moved fast. Lewis toured with Stapleton for the remainder of summer 2015, and by January 2016, found himself playing sold-out 2 and 3-night shows at venues like The Tabernacle and the Ryman Auditorium.During that time, Lewis was driving to play a show in Richmond when he spotted a bright, rainbow building just off the interstate. &quot;The building had a word on it, but all I could see was -SITY,&quot; he says, &quot;I immediately said &#39;loversity&#39;, even though the sign said &#39;di- versity&#39;. My friend and I Googled it and it wasn&#39;t a real word, but I thought, well, I like that word.&quot; A week later, Lewis returned home and immediately wrote &quot;Loversity&quot;, which would set the tone for his album.Lewis&#39; forthcoming record Loversity is set to be released on May 4, 2018. The album is composed of 14 tracks that Lewis has spent over a year and a half writing and playing for others. Since Waiting on You, his classic style remains present yet matured, with a more re- fined worldview, &quot;These newer songs have been harder to write, but extremely necessary given the current climate I find the world in.&quot; Recorded at Southern Ground Studios with engineer and co-producer Brandon Bell, the album spans from upbeat songs like the title track &quot;Loversity&quot; to the darker &quot;One in the Same,&quot; an electric guitar heavy ballad with a dri- ving force reminiscent of the Black Keys&#39; Brothers. While most songs are originals, the record includes &quot;Accidental Harmony&quot;, a lullaby that fellow Nashville songwriter John Mann wrote for his first born child, and &quot;Natural Disaster&quot;, a Loudon Wainwright song that Lewis felt drawn to.And while each song varies in tone, they all circle back to one universal theme. &quot;This is the closest thing I&#39;ll ever write to a concept album. The idea is that we are all trying to get somewhere -- all running from something and toward something. We&#39;re all together in it, though.&quot; As current events in the world divide the masses based on difference, Sam Lewis&#39; new album is a soul-filled, catchy collection of reminders that diversity and unity can co-exist.",
